		return yMax;
	}



	@Override
	public double getYMin() {
		return yMin;
	}



	@Override
	public void setXMax(double newValue) {
		xMax = newValue;
		if (getXMin() > getXMax()) {
			setXMin(getXMax());
		}
		adjustTick();
	}



	@Override
	public void setXMin(double newValue) {
		yMin = newValue;
		if (getXMax() < getXMin()) {
			setXMax(getXMin());
		}
		adjustTick();
	}



	@Override
	public void setYMax(double newValue) {
		yMax = newValue;
		if (getYMin() > getYMax()) {
			setYMin(getYMax());
		}
		adjustTick();
	}



	@Override
	public void setYMin(double newValue) {
		yMin = newValue;
		if (getYMax() < getYMin()) {
			setYMax(getYMin());
		}
		adjustTick();
	}



	@Override
	public void adjustTick() {
		xLines = new ArrayList<PlaneLineTickInterface> ();
		yLines = new ArrayList<PlaneLineTickInterface> ();
		
		xLines.add(new XLineTick(getX(), getY(), X_LENGTH, new BasicStroke(0.5f), ""));
		yLines.add(new YLineTick(getX(), getY() - Y_LENGTH, Y_LENGTH, new BasicStroke(0.5f), ""));
		
		for (int i = 1; i < xTickNumber; i ++) {
			xLines.add(new XLineTick(getX(), getY() - i * xStep, TICK_LENGTH, new BasicStroke(0.5f), ""));
		}
		for (int i = 1; i < yTickNumber; i ++) {
			yLines.add(new YLineTick(getX() + i * yStep, getY() - TICK_LENGTH, TICK_LENGTH, new BasicStroke(0.5f), ""));
		}
		
		
		String precisionString = String.format("%d", getPrecision());
		String tickString = "%.".concat(precisionString).concat("f");
		
		
		double x_gap = (getXMax() - getXMin()) / (xTickNumber - 1);
		double y_gap = (getYMax() - getYMin()) / (yTickNumber - 1);
		for (int i = 0; i < xTickNumber; i ++) {
			getXLines().get(i).getTick().setText(String.format(tickString, getXMin() + x_gap * i));
		}
		for (int i = 0; i < yTickNumber; i ++) {
			getYLines().get(i).getTick().setText(String.format(tickString, getYMin() + y_gap * i));
		}
		
		
	}



	@Override
	public int getXTickNumber() {
		return xTickNumber;
	}



	@Override
	public int getYTickNumber() {
		return yTickNumber;
	}



	@Override
	public void setXTickNumber(int newXTickNumber) {
		xTickNumber = newXTickNumber;
		setXStep((int) Math.floor(X_LENGTH/xTickNumber));
		adjustTick();
	}



	@Override
	public void setYTickNumber(int newYTickNumber) {
		yTickNumber = newYTickNumber;
		setYStep((int) Math.floor(Y_LENGTH/yTickNumber));
		adjustTick();
	}



	@Override
	public int getX() {
		return x;
	}



	@Override
	public int getY() {
		return y;
	}



	@Override
	public void setX(int newX) {
		x = newX;
	}



	@Override
	public void setY(int newY) {
		y = newY;
	}



	@Override
	public int getXStep() {
		return xStep;
	}



	@Override
	public int getYStep() {
		return yStep;
	}



	@Override
	public void setXStep(int newXStep) {
		xStep = newXStep;
	}



	@Override
	public void setYStep(int newYStep) {
		yStep = newYStep;
	}



	@Override
	public int getPrecision() {
		return precision;
	}



	@Override
	public void setPrecision(int newPrecision) {
		precision = newPrecision;
		adjustTick();
	}

